UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'FTQI' THEN 0.7709999999999999 WHEN 'FEX' THEN 1.339 WHEN 'DBE' THEN 2.347 WHEN 'BKUI' THEN 0.738 WHEN 'ASET' THEN 1.13 WHEN 'IVW' THEN 0.504 WHEN 'FLKR' THEN 1.6500000000000001 WHEN 'FLQS' THEN 0.596 WHEN 'SUPL' THEN 1.838 WHEN 'IXUS' THEN 4.42 WHEN 'DAPP' THEN 2.4589999999999996 WHEN 'TVAL' THEN 0.532 WHEN 'SPVU' THEN 1.371 WHEN 'FDTS' THEN 1.609 WHEN 'DIG' THEN 1.043 WHEN 'GLIN' THEN 2.818 WHEN 'IUSG' THEN 0.8919999999999999 WHEN 'SDD' THEN 0.668 WHEN 'BBIN' THEN 2.026 WHEN 'IWD' THEN 3.6420000000000003
    END,
    updatedat = NOW()
    WHERE symbol IN ('FTQI', 'FEX', 'DBE', 'BKUI', 'ASET', 'IVW', 'FLKR', 'FLQS', 'SUPL', 'IXUS', 'DAPP', 'TVAL', 'SPVU', 'FDTS', 'DIG', 'GLIN', 'IUSG', 'SDD', 'BBIN', 'IWD');